/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `split_str`(x NVARCHAR(500), delim VARCHAR(12), pos INT) RETURNS varchar(255) CHARSET utf8mb3 COLLATE utf8mb3_unicode_ci
    READS SQL DATA
    DETERMINISTIC
BEGIN
	RETURN trim(replace(substring(substring_index(x collate utf8_unicode_ci, delim, pos), length(substring_index(x collate utf8_unicode_ci, delim, pos -1)) + 1), delim, ''));
