/* Procedure structure for procedure `sp_asasinp` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_asasinp` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`jepezaco_systemas_alf3`@`%` PROCEDURE `sp_asasinp`(optn smallint, prexa varchar(200), motoa varchar(200), resta varchar(200), fruca varchar(200))
BEGIN
declare mava varchar(200) default '';  declare mave varchar(200) default '';  declare mavi varchar(200) default '';
declare mavo varchar(200) default '';  declare mavu varchar(200) default '';  declare nowa datetime;
declare mapa varchar(200) default '';  declare mape varchar(200) default '';  declare mapi varchar(200) default '';
declare mapo varchar(200) default '';  declare mapu varchar(200) default '';
declare sala smallint default 0;       declare sale smallint default 0;
set mava = '|@';
set nowa = date_add(now(), interval -0 hour);

if optn = 103 then
	set mave = split_str(prexa,'@',1);	-- ruc+din
	set mavi = split_str(prexa,'@',2);	-- tipo
	select ifnull(rucaw,''), ifnull(dina,'') into mavo, mavu from tc_logadet where md5(concat(rucaw,dina,mava)) = mave and flgac = 1;

	set mapa = split_str(resta,'@',1);	-- coor
	set mape = split_str(resta,'@',2);	-- obse
	set mapi = split_str(fruca,'@',1);	-- fecha hora
	set mapo = split_str(fruca,'@',2);	-- senso

	select timestampdiff(minute, nowa, mapi) into sala;
    if (sala between -1 and 1) then
		if not mavo = '' and not mavu = '' then
			insert tt_asassin(rucaw, dinaw, marqa, tippo, senso, cordx, direx, obser, macax, fecha)
			select mavo, mavu, mapi, mavi, mapo, mapa, motoa, mape, '', nowa;

			select 1200 samba, 'Asistencia agregada' sambe, 1 sambi;
        else
			select 1001 samba, 'Usuario incorrecto' sambe, -1 sambi;
        end if;
    else
		select 1001 samba, 'Fecha, hora incorrecta' sambe, -1 sambi;
    end if;
end if;

END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_asasinq` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_asasinq` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`jepezaco_systemas_alf3`@`%` PROCEDURE `sp_asasinq`(optn smallint, prexa varchar(200), motoa varchar(200), resta varchar(200), fruca varchar(200))
BEGIN
-- declare mava varchar(200) default '';  declare mave varchar(200) default '';  declare mavi varchar(200) default '';
-- declare nowa datetime;
-- set mava = '|@';
-- set nowa = date_add(now(), interval -0 hour);

if optn = 104 then
	select a.dinaw bamba, b.detay bambe, date_format(a.marqa,'%d/%m/%y %H:%i') bambi, a.tippo bambo, a.cordx bambu, a.direx gamba, a.obser gambe
	, concat('https://maps.google.com/?q=',replace(cordx,' ',''),'&z=8') gambi 
	from tt_asassin a join tc_logadet b on a.dinaw = b.dina and b.flgac = 1 and a.rucaw = b.rucaw 
	where a.flgac = 1 and a.rucaw = prexa and month(str_to_date(marqa,'%Y-%m-%d')) = month(str_to_date(motoa,'%Y-%m-%d')) 
	order by a.marqa desc, b.detay;
end if;

END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_logacap` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_logacap` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`jepezaco_systemas_alf3`@`%` PROCEDURE `sp_logacap`(optn smallint, prexa varchar(100), motoa varchar(100), resta varchar(100), fruca varchar(100))
BEGIN
declare mava varchar(100) default('');  declare mave varchar(100) default('');  declare mavi varchar(100) default('');
declare mavo varchar(100) default('');  declare mavu varchar(100) default('');
set mava = '|@';

if optn = 108 then
	select ifnull(rucaw,'') into mave from tc_logadet where md5(concat(rucaw,dina,mava)) = prexa and flgac = 1;
	
	if not mave = '' then
		select 1200 samba, 'Placas Agregadas' sambe, parqa sambi, flgac sambo from tc_vehicla where flgac = 1 and rucaw = mave;
	else
		select 1001 samba, 'Placas Incorrectas' sambe, '' sambi, '' sambo;
	end if;
end if;

if optn = 102 then
	select yunga into mave from tc_logacab where flgac = 1 and rucax = prexa;
	select deta1 into mavi from tc_confixa where nomba = 'Galon1';
	
	select mave samba, mavi sambe;
end if;

if optn = 104 then
	select a.divin, b.yunge, a.flgac into mave, mavi, mavo 
	from tc_logadet a join tc_logacab b on md5(concat(a.rucaw,a.dina,mava)) = b.rucax and a.flgac = b.flgac
	where md5(concat(a.rucaw,mava,a.dina,mava,aes_decrypt(unhex(a.dnoma),b.yunga))) = prexa;
	
	if mave = '' and mavi = '' then
		select 1001 samba, 'Usario Incorrecto' sambe, -1 sambi, '' sambo, -1 sambu
		/*, motoa campa, resta campe*/;
	else
		select 1200 samba, 'Bienvenido' sambe, mave sambi, mavi sambo, mavo sambu
		/*, motoa campa, resta campe*/;
	end if;
end if;

if optn = 106 then
	select yunge into mave from tc_logacab where flgac = 1 and rucax = prexa;
	select deta1 into mavi from tc_confixa where nomba = 'Galon1';
	
	select mave samba, mavi sambe;
end if;

	END */$$
DELIMITER ;

