/*!50003 CREATE DEFINER=`jepezaco_systemas_alf3`@`%` PROCEDURE `sp_qilobep`(optn smallint, prexa varchar(200), motoa varchar(200), resta varchar(200), fruca varchar(200))
BEGIN
declare mava varchar(200) default '';  declare mave varchar(200) default '';  declare mavi varchar(200) default '';
