declare mapa varchar(200) default '';  declare mape varchar(200) default '';  declare mapi varchar(200) default '';
declare mapo varchar(200) default '';  declare mapu varchar(200) default '';
declare sala smallint default 0;       declare sale smallint default 0;
declare exit handler for 1062 begin
	if optn = 122 then
		select 1001 samba, 'Duplicado' sambe, -1 sambi;
	end if;
end;
-- --------------
-- --------------
set mava = '|@';
set nowa = date_add(now(), interval -0 hour);

if optn = 124 then
	update tt_qilombe set flgim = 1 where direx = motoa;
	if row_count() = 0 then
		select '-1002' samba, 100 sambe;
	else
		select 1300 samba, 0 sambe;
	end if;
end if;

if optn = 122 then
	set mave = split_str(motoa,'@',1);	-- placa
	set mavi = split_str(motoa,'@',2);	-- valor
	select ifnull(rucaw,''), ifnull(dina,'') into mavo, mavu from tc_logadet where md5(concat(rucaw,dina,mava)) = prexa and flgac = 1;
	set mapa = split_str(resta,'@',1);	-- image
	set mape = split_str(resta,'@',2);	-- fechora

	set mapi = split_str(fruca,'@',1);	-- obser
	set mapo = split_str(fruca,'@',2);	-- tipo

